package com.studio.common.result;/** * description: * author:          song * createDate:      2018/1/24 */public class UploaderFile {    private long fileSize;    private String fileName;    private String filePath;    private String realFileName;    private String fileType;    public long getFileSize() {        return fileSize;    }    public void setFileSize(long fileSize) {        this.fileSize = fileSize;    }    public String getFileName() {        return fileName;    }    public void setFileName(String fileName) {        this.fileName = fileName;    }    public String getFilePath() {        return filePath;    }    public void setFilePath(String filePath) {        this.filePath = filePath;    }    public String getRealFileName() {        return realFileName;    }    public void setRealFileName(String realFileName) {        this.realFileName = realFileName;    }    public String getFileType() {        return fileType;    }    public void setFileType(String fileType) {        this.fileType = fileType;    }}